import React, { Component } from 'react'
import {Navbar} from 'react-bootstrap'
import light from './img/light'

export default class Header extends Component {
  render() {
    return (
     <Navbar collapseOnSelect expand="md" bg="dark">
        <Container>
            <Nav.Link><p>Нужна помощь? </p></Nav.Link>
            <Nav.Link><p> еДиплом </p></Nav.Link>
            <Nav.Link><img src="{% static '/img/notification.png' %}" width="25" height="25" alt="Icon" loading="lazy" id="theme-toggle"/></Nav.Link>

        </Container>
        </Navbar>
    )
  }
}
